CREATE TABLE `order_pp` (
  `id` mediumint(20) NOT NULL AUTO_INCREMENT,
  `order_id` bigint(20) DEFAULT NULL COMMENT '己方订单ID',
  `billno` varchar(50) DEFAULT NULL COMMENT '订单ID',
  `account` varchar(50) DEFAULT NULL COMMENT '道具名',
  `amount` double(8,2) DEFAULT NULL COMMENT '道具数量',
  `app_id` int(10) DEFAULT NULL COMMENT '1 对应 30\r\n，2 对应 50\r\n以这样的方式来标示价钱',
  `uuid` char(40) DEFAULT NULL,
  `roleid` varchar(50) DEFAULT NULL COMMENT '渠道编码',
  `zone` int(10) DEFAULT NULL COMMENT '渠道标识',
  `rechargeTime` datetime DEFAULT NULL COMMENT '入库时间',
  `status` tinyint(1) DEFAULT '0' COMMENT '0代表道具未发放，1代表道具已经发放',
  `givingTime` datetime DEFAULT NULL COMMENT '道具发放时间',
  PRIMARY KEY (`id`),
  KEY `time` (`rechargeTime`) USING BTREE,
  KEY `roleid` (`roleid`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=50 DEFAULT CHARSET=utf8;
